import React from "react";
import "./App.css";

function Nav({onAddAthleteClick}) {

  function handleAddAthleteClick(e) {
    onAddAthleteClick(e)
  }


return (
    <div id="nav">
        <button className="nav_button" onClick={handleAddAthleteClick}>Add Athlete</button>
        <button className="nav_button">Add Workout</button>
    </div>

  );
}
export default Nav
